export const signoutAction = (dispatch, history) => {
    dispatch({type: "LOGIN_DEFAULT", objectives: data.objectives})
    dispatch({type: "CLOCK_DEFAULT", objectives: data.objectives})
    dispatch({type: "OBJECTIVE_DEFAULT", objectives: data.objectives})
    history.push("/")
}
